from PIL import Image
import base64
import io

def setup_images():
	data = ""
	size = 3221, 1921
	blade_image = decode_base64_image(size, data)

	size = (1196, 832)
	data = ""
	neo_image = decode_base64_image(size, data)

	scale = 0.7
	size = (int(850*scale), int(578*scale))
	data = ""
	riser_image = decode_base64_image(size, data)
	
	data = ""
	flexcom_image = decode_base64_image(size, data)
	
	size = (1526, 625)
	data = ""
	psu_image = decode_base64_image(size, data)
	
	return blade_image, neo_image, riser_image, flexcom_image, psu_image

def decode_base64_image(size, data):

	msg = base64.b64decode(data)
	buf = io.BytesIO(msg)
	
	i = Image.open(buf)
	i.thumbnail(size, Image.ANTIALIAS)
	
	# adding transparent padding before text
	new_image = Image.new('RGBA', (size[0]+5, size[1]), (0, 0, 0, 0))
	new_image.paste(i, (0, 0))
	
	return new_image